import React from "react";
import { NavLink } from "react-router-dom";
import "./Nav.css";
const style = {
  color: "fuchsia",
  fontWeight: "bold",
  border: "5px solid fuchsia",
};

function Nav() {
  
  return (
    <>
      <nav className="nav">
        <NavLink activeStyle={style} className="NavLink" to="/" exact>
          <i className="fas fa-house-user"></i>
          Home
        </NavLink>
        <NavLink activeStyle={style} className="NavLink" to="/skill">
          <i className="fas fa-star-half-alt"></i> Skills
        </NavLink>
        <NavLink activeStyle={style} className="NavLink" to="/projects">
          <i className="fas fa-code"></i> Projects
        </NavLink>
        <NavLink activeStyle={style} className="NavLink" to="/contact">
          <i className="far fa-address-card"></i>Contact
        </NavLink>
      </nav>
    </>
  );
}
<NavLink activeStyle={style} className="NavLink" to="/" exact>
<i className="fas fa-house-user"></i>
Home
</NavLink>

const Navlink = ({path})=>{
  return (
    <NavLink activeStyle={style} className="NavLink" to={path}>
      
    </NavLink>
  )
}


<Navlink />


export default Nav;
